import {initVue} from "./app";

export default context => {
  const { app } = initVue();
  return new Promise((resolve, reject) => {
    const { app, store, router, App } = initVue();
    let components = App.components;
    let asyncDataPromiseFns = [];
  
    Object.values(components).forEach(component => {
      if (component.asyncData) {
        asyncDataPromiseFns.push(component.asyncData({ store }));
      }
    });

    Promise.all(asyncDataPromiseFns).then((result) => {
      context.state = store.state;
      resolve(app);
    }, reject).catch((err)=>{
        console.log("error~~~~~~~~~~~~~");
        console.log(err);
    });
  });
}

import Vue from 'vue';
import Router from 'vue-router';

Vue.use(Router);

export function initRouter(){
  const router=new Router({
    mode: 'history',
    routes: [
      {path:"/compt1",component:()=>import("./components/Compt1.vue")},
      {path:"/compt2",component:()=>import("./components/Compt2.vue")},
      {path:"/compt3",component:()=>import("./components/Compt3.vue")}
    ]
  });
  return {router};
}

import Vue from "vue";
import Vuex from "vuex";
import {httpAjax} from "./common/fetch";

Vue.use(Vuex);
const GET_HTTP="getHttp";

export function initStore(){
  const store=new Vuex.Store({
    state:{
      msg:""
    },
    mutations:{
      [GET_HTTP](state,data){
        state.msg=data;
      }
    },
    actions:{
      testHttp:({commit})=>{
        return httpAjax().then((res)=>{
          commit(GET_HTTP,res);
        });
      }
    }
  });
  if (typeof window !== 'undefined' && window.__INITIAL_STATE__) {
    console.log('window.__INITIAL_STATE__', window.__INITIAL_STATE__);
    store.replaceState(window.__INITIAL_STATE__);
  } else {
    console.log('no browser');
  }
  return {store};
}
